package com.melonlee.ewd.bean;public class AccountBean {	private Integer id;	private String title;	private String token;	private String createDate;	private String devUrl;    private MessageBean defaultMsg;    public MessageBean getDefaultMsg() {        return defaultMsg;    }    public void setDefaultMsg(MessageBean defaultMsg) {        this.defaultMsg = defaultMsg;    }    public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getToken() {		return token;	}	public void setToken(String token) {		this.token = token;	}	public String getCreateDate() {		return createDate;	}	public void setCreateDate(String createDate) {		this.createDate = createDate;	}	public String getDevUrl() {		return devUrl;	}	public void setDevUrl(String devUrl) {		this.devUrl = devUrl;	}}